import 'styles/test.css';
import React from 'react';

function Header() {
  return (
    <header>
      <a href="/">
        <img src='logo.svg' alt='Website logo'/>
      </a>
      <nav>
        <ul>
          <li>About</li>
          <li>Resources</li>
          <li class="selected">Glazes</li>
        </ul>
      </nav>
    </header>
    )
}

export default Header;
